import React from "react";

function About() {
  return (
    <div>
      <h2>Welcome to Our Online Store!</h2>
      <p>
        Thank you for visiting our store. We offer a wide range of products to
        meet your needs. Whether you're looking for electronics, clothing,
        accessories, or home goods, we've got you covered. Browse through our
        selection and enjoy a seamless shopping experience. We're here to make
        your online shopping journey enjoyable and convenient. Start exploring
        our store now!
      </p>
    </div>
  );
}

export default About;
